font-family: 'Pacifico', cursive;

position: fixed;
left: 2rem;
top: 2rem;
z-index: 3;
`

const LogoComponent = (props) => {
    return (
        <Logo color={props.theme} to={{pathname:"/blog"}}>
            EC
        </Logo>
    )
}

